import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Locate the search input field using its placeholder text
    const searchInput = page.getByPlaceholder('Search Amazon');
    await searchInput.waitFor({ state: 'visible', timeout: 5000 });

    // Type a search query to trigger the autocomplete suggestions
    await searchInput.type('electro', { delay: 150 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_text_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_text_entered.png'));

    // Wait for the suggestions container to become visible
    const suggestionsContainer = page.locator('.search-suggestions');
    await suggestionsContainer.waitFor({ state: 'visible', timeout: 5000 });

    // Take a screenshot of the visible suggestions
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_suggestions_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_suggestions_visible.png'));

    // Extract the text content of all suggestion items
    const suggestionItems = await page.locator('.suggestion-item').allTextContents();

    const extractedData = {
      searchQuery: await searchInput.inputValue(),
      suggestions: suggestionItems,
      suggestionCount: suggestionItems.length
    };

    return {
      success: true,
      action: "Typed into the search bar and verified that autocomplete suggestions appeared.",
      extractedData: extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
